export const images = [
	{ name: 'imgone', url: require('./assets/one.png') },
	{ name: 'imgtwo', url: require('./assets/two.png') },
	{ name: 'imgthree', url: require('./assets/three.png') },
	{ name: 'imgfour', url: require('./assets/four.png') }
];

export const shopItems = [
	{ name: 'girl', url: require('./assets/girl.png') },
	{ name: 'men', url: require('./assets/men.png') },
	{ name: 'women', url: require('./assets/women.png') },
	{ name: 'food', url: require('./assets/food.png') },
	{ name: 'furniture', url: require('./assets/furniture.png') },
	{ name: 'beauty', url: require('./assets/beauty.png') }
];
